    // if (util.runtime.audioEngine === null) return;
    // if (util.target.sprite.soundBank === null) return;
    // const dx = Cast.toNumber(args.x);
    // const dy = Cast.toNumber(args.y);
    // const allTargets = this.runtime.targets;
